import React from 'react';

const Footer = () => {
    const styleSpan = {

        fontStyle: "normal",
        fontWeight: "400",
        fontSize: "18px",
        height: "20px",

        color: "#ffffff"

}
    return (
        <div style={{
            width: "100%",
            height: "198px",
            background: "rgba(0, 0, 0, 0.6)",
            display: "flex"
        }}>
            <div className="flex my-4 flex-nowrap h-3">
                <div style={styleSpan}>Общая информация</div>
                <div style={styleSpan}>Политика конфиденциальности</div>
                <div style={styleSpan}>Пользовательское соглашение</div>
            </div>
            <div style={styleSpan}>Разработано студентами ЮФУ</div>
        </div>
    );
};

export default Footer;
